import Companies from '../Component/Company';
import Indicators from '../Component/Indicators';
import StopProfit from '../Component/StopProfit';
import StopLoss from '../Component/StopLoss'
import { Space, Button } from 'antd'
import { useState } from 'react';

const Create = ({ setClickCheck }) => {

    const [company, setCompany] = useState('台積電')
    const [indacator, setIndicator] = useState('RSI')
    const [rate, setRate] = useState(3)

    return(
        <div className='schedule'>
            <Companies setCompany={setCompany} />
            <Indicators setIndicator={setIndicator} setRate={setRate} />
            <StopProfit />
            <StopLoss />
            <Button onClick={()=>setClickCheck(true)}>確定</Button>
        </div>
    )
}

export default Create
